import React from 'react'
import './App.css'
function App() {
  return (
    <div class='App'>
      <div class='images'></div>
      <div class='id'>
      <input type="text" class="form-control" placeholder="Username@example.com" aria-label="Recipient's username" aria-describedby="basic-addon2"/>
      </div>
      <div class="password">
      <input type="password" class="form-control" placeholder="Password" aria-label="Recipient's username" aria-describedby="basic-addon2"/>
      </div>
      <div class="login-btn">
      <button type="button" class="btn btn-primary">로그인</button>
      </div>
  </div>
  );
}

export default App;
